import React, { Component } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { Button, CardDeck, Card} from 'react-bootstrap';
import ViewPolicy from "./viewPolicy.component";

class Policy extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return(
            <Card>
            <Card.Header as="h5">{this.props.policy.name}</Card.Header>
            <Card.Img variant="top" src="holder.js/100px160" />
            <Card.Body>
            <Card.Title>Description</Card.Title>
            <Card.Text>
            This is a wider card with supporting text below as a natural lead-in to
            additional content. This content is a little bit longer.
            </Card.Text>
            <Card.Title>Details</Card.Title>
            <Card.Text>
            Duration: {this.props.policy.duration}  years
            Premium: {this.props.policy.premium}  /month
            </Card.Text>
            </Card.Body>
            <Card.Footer>
            <small className="text-muted">Terms and Conditions Apply</small>
            </Card.Footer>
            </Card>
        );
    }
}

export default class OtherPage extends  Component {
    constructor(props){
        super(props);
        this.state = {policies: []};
    }

    componentDidMount() {
        axios.get('http://localhost:4000/policy/', {withCredentials: true})
        .then(response => {
            this.setState({ policies: response.data });
        })
        .catch(function (error){
            console.log(error);
        }   )
    }

    policyList() {
        return this.state.policies.map(function(currentPolicy, i){
            return (<Policy policy={currentPolicy} key={i} />);
        })
    }

    render(){
        return (
            <div>
            <CardDeck>
            <Card>
            <Card.Img variant="top" src="holder.js/100px160" />
            <Card.Body>
            <Card.Title>Card title</Card.Title>
            <Card.Text>
            This card has supporting text below as a natural lead-in to additional
            content.{' '}
            </Card.Text>
            </Card.Body>
            <Card.Footer>
            <small className="text-muted">Last updated 3 mins ago</small>
            </Card.Footer>
            </Card>
            <Card>
            <Card.Img variant="top" src="holder.js/100px160" />
            <Card.Body>
            <Card.Title>Card title</Card.Title>
            <Card.Text>
            This is a wider card with supporting text below as a natural lead-in to
            additional content. This card has even longer content than the first to
            show that equal height action.
            </Card.Text>
            </Card.Body>
            <Card.Footer>
            <small className="text-muted">Last updated 3 mins ago</small>
            </Card.Footer>
            </Card>
            </CardDeck>
            </div>
        );
    }
}
